import React, { useState } from "react";
import "./UserDashboard.css";

function UsuarioDashboard() {
  const [showModal, setShowModal] = useState(null);
  const [modalData, setModalData] = useState(null);
  const [nuevoNombreUsuario, setNuevoNombreUsuario] = useState("");
  const [nombreUsuario, setNombreUsuario] = useState("");
  const [dni, setDni] = useState("");
  const [nuevaContrasena, setNuevaContrasena] = useState("");
  const [idReclamo, setIdReclamo] = useState("");
  const [codigoEdificio, setCodigoEdificio] = useState("");
  const [piso, setPiso] = useState("");
  const [numero, setNumero] = useState("");

  const fetchAPI = async (url, method, headers, body) => {
    try {
      const response = await fetch(url, { method, headers, body: JSON.stringify(body) });
      const data = await response.json();
      if (response.ok) {
        setModalData(data);
        setShowModal('showData');
      } else {
        throw new Error(data.message || "Error desconocido");
      }
    } catch (error) {
      alert(`Error: ${error.message}`);
    }
  };

  const obtenerReclamoPorId = () => {
    fetchAPI(`http://localhost:8080/api/reclamos/${idReclamo}`, "GET", {
      "Content-Type": "application/json",
      Authorization: `Bearer ${localStorage.getItem("jwtToken")}`,
    });
  };

  const obtenerReclamosPorEdificio = () => {
    fetchAPI(`http://localhost:8080/api/reclamos/edificio/${codigoEdificio}`, "GET", {
      "Content-Type": "application/json",
      Authorization: `Bearer ${localStorage.getItem("jwtToken")}`,
    });
  };

  const obtenerReclamosPorUnidad = () => {
    fetchAPI(`http://localhost:8080/api/reclamos/unidad/${codigoEdificio}/${piso}/${numero}`, "GET", {
      "Content-Type": "application/json",
      Authorization: `Bearer ${localStorage.getItem("jwtToken")}`,
    });
  };

  const renderData = (data) => {
    if (!data) return "No data";
    if (Array.isArray(data)) {
      return data.map((item, index) => (
        <div key={index}>
          <div>{`Reclamo ID: ${item.id}`}</div>
          <div>{`Descripción: ${item.descripcion}`}</div>
          {/* Añade más campos según necesites */}
        </div>
      ));
    } else {
      return (
        <div>
          <div>{`Reclamo ID: ${data.id}`}</div>
          <div>{`Descripción: ${data.descripcion}`}</div>
          {/* Añade más campos según necesites */}
        </div>
      );
    }
  };

  return (
    <div className="user-dashboard">
      <header className="dashboard-header">
        <h1 className="dashboard-title">PROPSUITE</h1>
        <nav className="header-buttons">
          <div className="dropdown">
            <button className="nav-button">Usuario</button>
            <ul className="dropdown-menu">
              <li><button className="dropdown-item" onClick={() => setShowModal("actualizarNombreUsuario")}>Actualizar nombre de usuario</button></li>
              <li><button className="dropdown-item" onClick={() => setShowModal("restablecerContrasena")}>Restablecer contraseña</button></li>
              <li><button className="dropdown-item" onClick={() => setShowModal(null)}>Cerrar sesión</button></li>
            </ul>
          </div>
        </nav>
      </header>
      <div className="welcome-section">
        <h2 className="welcome-title">PROPSUITE</h2>
        <p className="welcome-subtitle">Bienvenidos a nuestro sistema, diseñado para hacer tu gestión fácil y dinámica.</p>
      </div>
      <div className="section-container">
        <h2 className="section-title">Reclamos</h2>
        <button className="section-button" onClick={obtenerReclamoPorId}>Ver Reclamo por ID</button>
        <button className="section-button" onClick={obtenerReclamosPorEdificio}>Ver Reclamos por Edificio</button>
        <button className="section-button" onClick={obtenerReclamosPorUnidad}>Ver Reclamos por Unidad</button>
      </div>
      <div className="section-container">
        <h2 className="section-title">Unidades</h2>
        <button className="section-button">Mis Unidades</button>
      </div>
      {showModal === "showData" && (
        <div className="modal">
          <div className="modal-content custom-modal">
            <h2 className="modal-title">Datos del Reclamo</h2>
            <div className="modal-result">
              {renderData(modalData)}
            </div>
            <div className="modal-buttons">
              <button className="section-button" onClick={() => setShowModal(null)}>Cerrar</button>
            </div>
          </div>
        </div>
      )}
      {/* Modales para actualizar nombre de usuario y restablecer contraseña */}
    </div>
  );
}

export default UsuarioDashboard;
